INSERT INTO `notices` (`notice_id`, `notice_title`, `notice_description`, `branch_id`, `notice_date`, `notice_time`, `notice_status_id`, `notice_status`) VALUES
(3, 'ওয়েবসাইটের নতুন টেকনোলোজি সংযোজন ও পারফরম্যান্স উন্নতির বিষয়ে জরুরী নটিশ', 'সকল আঞ্চলিক ব্রাঞ্চ প্রতিনিধিদের জানানো যাচ্ছে যে, ওয়েবসাইটের নতুন টেকনোলোজি সংযোজন ও পারফরম্যান্স উন্নতির কাজ চলছে। সেই কারণে সাময়িক অসুবিধার জন্য আমরা আন্তরিকভাবে দুঃখিত। ', 0, '30-08-2021', '10:53 am', 1, 'active'),
(5, 'সম্মানিত আঞ্চলিক পরিচালক,', 'ঈদ মোবারক । সবাইকে পবিত্র ঈদ-উল -ফিতর এর অগ্রীম শুভেচ্ছা । এত দ্বারা দক্ষ যুব আইসিটি উন্নয়নের সকল আঞ্চলিক পরিচালকদের অবগতির জন্য জানানো যাচ্ছে যে, পবিত্র শবে ক্বদর ও ঈদ- উল - ফিতর উপলক্ষে ০১/০৫/২০২২ তারিখ হতে ০৯/০৫/২০২২ তারিখ পর্যন্ত অত্র প্রতিষ্ঠান বন্ধ থাকবে । এবং আমাদের অনলাইন কার্য ক্রম চলমান থাকবে । ১০/০৫/২০২২ তারিখ থেকে অফিসিয়াল কার্যক্রম যথারীতি শুরু হবে ।', 0, '09-12-2021', '07:00 pm', 1, 'active'),
