(15, 'চূড়ান্ত পরীক্ষার জন্য অনলাইন রেজিস্ট্রেশন নোটিশ  জুলাই-সেপ্টেম্বর 2023 ইং সেশন এবং ১ম রেজিস্ট্রেশন ( জুলাই- ডিসেম্বর) ২০২৩ ইং সেশন', ' এতদ্বারা সকল পরিচালকদের অবগতির জন্য জানানো যাচ্ছে যে  দক্ষ যুব আইসিটি উন্নয়ন - এর (জুলাই-সেপ্টেম্বর / ৩মাস কোর্সের রেজিস্ট্রেশন শুরু হয়েছে । ( জুলাই- ডিসেম্বর) ২০২৩ ইং সেশন এর ০৬ মাস মেয়াদী কোর্সের ১ম পরীক্ষার অনলাইনে রেজিস্ট্রেশন নিম্ন সময়সুচি অনুযায়ী চলবে। অনলাইনে রেজিস্ট্রেশন শুরুর তারিখ : ০৪ সেপ্টেম্বর ২০২৩ ইং সোমবার সকাল ১০ টা থেকে রেজিস্ট্রেশন শুরু । অনলাইনে রেজিস্ট্রেশন শেষ তারিখ : ২৪ সেপ্টেম্বর ২০২৩ ইং রবিবার বিকাল ০৫ টা পর্যন্ত করা হয়েছে । রেজিস্ট্রেশন ফি পরিশোধের শেষ তারিখ : ২৫ সেপ্টেম্বর ২০২৩ ইং সোমবার বিকাল ০৫ টা পর্যন্ত। উপরোক্ত সময়ের মধ্যে সকল পরিচালকদের ইউজার আইডি ও পাসওয়ার্ড ব্যাবহার করে ছাত্র-ছাত্রীদের অনলাইন রেজিস্ট্রেশন (ছবিসহ) সম্পন্ন করার জন্য বিশেষভাবে অনুরোধ করা হল। বিঃ দ্রঃ অনলাইন রেজিস্ট্রেশন নির্ধারিত সময়ের মধ্যে (জুলাই-সেপ্টেম্বর / ৩মাস কোর্সের রেজিস্ট্রেশন না করলে কোন শিক্ষার্থী চুড়ান্ত পরীক্ষায় অংশগ্রহণ করতে পারবে না। বিশেষ প্রয়োজনে যোগাযোগ করুন : ০১৩০২-৫৭৩০৫২/০১৩০৮-৮৬০৬৩৫', 0, '26-08-2023', '06:50 pm', 1, 'active'),
(16, 'চূড়ান্ত পরীক্ষার জন্য অনলাইন রেজিস্ট্রেশন নোটিশ (জুলাই-সেপ্টেম্বর / অক্টোবর-ডিসেম্বর ৩মাস/জুলাই- ডিসেম্বর ৬মাস এবং জানুয়ারি–ডিসেম্বর ১ বছর কোর্সের) রেজিস্ট্রেশন শুরু হয়েছে ২০২৩ ইং সেশন।', 'এতদ্বারা সকল পরিচালকদের অবগতির জন্য জানানো যাচ্ছে যে দক্ষ যুব আইসিটি উন্নয়ন - এর (জুলাই-সেপ্টেম্বর /অক্টোবর- ডিসেম্বর ৩মাস।জুলাই- ডিসেম্বর ৬মাস এবং জানুয়ারি–ডিসেম্বর ১ বছর কোর্সের রেজিস্ট্রেশন শুরু হয়েছে ।   পরীক্ষার অনলাইনে রেজিস্ট্রেশন নিম্ন সময়সুচি অনুযায়ী চলবে। অনলাইনে রেজিস্ট্রেশন শুরুর তারিখ : ১৫ নভেম্বর ২০২৩ ইং বুধবার সকাল ১০ টা থেকে রেজিস্ট্রেশন শুরু । অনলাইনে রেজিস্ট্রেশন শেষ তারিখ : ১৪ ডিসেম্বর ২০২৩ ইং বৃহস্পতিবার বিকাল ০৫ টা পর্যন্ত করা হয়েছে । রেজিস্ট্রেশন ফি পরিশোধের শেষ তারিখ : ১৭ ডিসেম্বর ২০২৩ ইং রবিবার বিকাল ০৫ টা পর্যন্ত। উপরোক্ত সময়ের মধ্যে সকল পরিচালকদের ইউজার আইডি ও পাসওয়ার্ড ব্যবহার করে ছাত্র-ছাত্রীদের অনলাইন রেজিস্ট্রেশন (ছবিসহ) সম্পন্ন করার জন্য বিশেষভাবে অনুরোধ করা হল।   বিশেষ প্রয়োজনে যোগাযোগ করুন : ০১৩০২-৫৭৩০৫২/০১৩০৮-৮৬০৬৩৫', 0, '08-11-2023', '11:22 am', 1, 'active'),
(17, 'পরীক্ষার নোটিশ সংক্রান্ত বিজ্ঞপ্তি ( জুলাই-অক্টোবর)/(অক্টোবর-ডিসেম্বর)/(জুলাই- ডিসেম্বর)/(জানুয়ারী- ডিসেম্বর)সেশনের পরীক্ষার ২০২৩ ইং সেশন। ', 'এতদ্বারা সকল পরিচালকদের অবগতির জন্য জানানো যাচ্ছে যে , দক্ষ যুব আইসিটি উন্নয়ন –( জুলাই-অক্টোবর)/(অক্টোবর- ডিসেম্বর)/(জুলাই- ডিসেম্বর)/(জানুয়ারী- ডিসেম্বর)সেশনের পরীক্ষার ২০২৩ ইং সেশন। আগামী ২৯ ডিসেম্বর শুক্রবার সকাল ১০ থেকে ১১:৩০ মিনিট পর্যন্ত সকল ব্রাঞ্চের পরীক্ষা অনুষ্ঠিত হবে রেজিস্ট্রেশন ফি পরিশোধের শেষ তারিখ : ১৭ ডিসেম্বর ২০২৩ ইং রবিবার বিকাল ০৫ টা পর্যন্ত। উপরোক্ত সময়ের মধ্যে সকল পরিচালকদের ইউজার আইডি ও পাসওয়ার্ড ব্যবহার করে ছাত্র-ছাত্রীদের অনলাইন রেজিস্ট্রেশন (ছবিসহ) সম্পন্ন করার জন্য বিশেষভাবে অনুরোধ করা হল। বিশেষ প্রয়োজনে যোগাযোগ করুন : ডাচবাংলা - ০১৩০২-৫৭৩০৫২ / বিকাশ-০১৩০৮৮৬০৬৩৫ / নগদ- ০১৯৩৩৮৪০৮২০', 0, '13-12-2023', '10:40 am', 1, 'active'),
(18, 'পরীক্ষার নোটিশ এবং রেজিস্ট্রেশন বর্ধিত সময় সংক্রান্ত বিজ্ঞপ্তি ( জুলাই-অক্টোবর)/(অক্টোবর-ডিসেম্বর)/(জুলাই- ডিসেম্বর)/(জানুয়ারী- ডিসেম্বর) সেশনের পরীক্ষার ২০২৩ ইং সেশন।', 'এতদ্বারা সকল পরিচালকদের অবগতির জন্য জানানো যাচ্ছে যে , দক্ষ যুব আইসিটি উন্নয়ন –( জুলাই-অক্টোবর)/(অক্টোবর- ডিসেম্বর)/(জুলাই- ডিসেম্বর)/(জানুয়ারী- ডিসেম্বর)সেশনের পরীক্ষার ২০২৩ ইং সেশন। আগামী ২৯ ডিসেম্বর শুক্রবার সকাল ১০ থেকে ১১:৩০ মিনিট পর্যন্ত সকল ব্রাঞ্চের পরীক্ষা অনুষ্ঠিত হবে। অনলাইনে রেজিস্ট্রেশন শুরুর তারিখ : ১৫ নভেম্বর ২০২৩ ইং বুধবার সকাল ১০ টা থেকে রেজিস্ট্রেশন শুরু ।বিশেষ বিবেচনায় অনলাইনে রেজিস্ট্রেশন শেষ তারিখ : ১৮ ডিসেম্বর ২০২৩ ইং সোববার বিকাল ০৫ টা পর্যন্ত বাড়ানো হয়েছে । রেজিস্ট্রেশন ফি পরিশোধের শেষ তারিখ : ২০ ডিসেম্বর ২০২৩ ইং বুধবার বিকাল ০৫ টা পর্যন্ত। উপরোক্ত সময়ের মধ্যে সকল পরিচালকদের ইউজার আইডি ও পাসওয়ার্ড ব্যবহার করে ছাত্র-ছাত্রীদের অনলাইন রেজিস্ট্রেশন (ছবিসহ) সম্পন্ন করার জন্য বিশেষভাবে অনুরোধ করা হল। অনলাইন ফি পরিশোধের জন্য যোগাযোগ করুন : ডাচবাংলা - ০১৩০২-৫৭৩০৫২ / বিকাশ-০১৩০৮৮৬০৬৩৫ / নগদ- ০১৯৩৩৮৪০৮২০', 0, '14-12-2023', '10:24 am', 1, 'active');
